import React from 'react';
import ReactDOM from 'react-dom';
import './App.css'
import App from './components/App';
import * as serviceWorker from './serviceWorker';


const userComments = [
{
    name: "Michael Lyons",
    date: "7/4/2018",
    text: "They BLEW the ROOF off at their last show, once everyone started figuring out they were going. This is still simply the greatest opening of acconcert I have EVER witnessed."
},
{
    name: "Gary Wong",
    date: "7/5/2018",
    text: "Every time I see him shred I feel so motivated to get off my couch and hop on my board. He’s so talented! I wish I can ride like him one day so I can really enjoy myself!"
},
{
    name: "Theodore Duncan",
    date: "7/5/2018",
    text: "How can someone be so good!!! You can tell he lives for this and loves to do it every day. Everytime I see him I feel instantly happy! He’s definitely my favorite ever!"
}
];



const nextVideoList = [

    {
        image: '../images/video-list-1.jpg',
        title: 'The Miracle of Childbirth',
        user: 'Natasha Webber'
    },
    {
        image: '../images/video-list-2.jpg',
        title: 'The Underworld for Idiots',
        user: 'Malcolm Cochies'
    },
    {
        image: '../images/video-list-3.jpg',
        title: 'Health Foods for Yogis of Idaho',
        user: 'Willard Maxim'
    },
    {
        image: '../images/video-list-4.jpg',
        title: 'Airballoon Death Stats',
        user: 'Malcolm Cochies'
    },
    {
        image: '../images/video-list-5.jpg',
        title: 'The Art of Staycation',
        user: 'Wallace Manly'
    },
    {
        image: '../images/video-list-6.jpg',
        title: 'STFU & Rest',
        user: 'Bernice Johnson'
    },
    {
        image: '../images/video-list-7.jpg',
        title: 'Cruising for a Brusing',
        user: 'Walter Lim'
    },
    {
        image: '../images/video-list-8.jpg',
        title: 'Sustainable ',
        user: 'Malcolm Cochies'
    }
]

ReactDOM.render(<App userComments={userComments} nextVideoList={nextVideoList}/>, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
